INSERT INTO `personal` (`PersonalNr`, `Nachname`, `Vorname`, `Position`, `Titel`, `Geschlecht`, `Geburtsdatum`, `Nationalitaet`, `Einstellung`, `DurchwahlOffice`, `Bemerkungen`) VALUES
                                                                                                                                                                                      (1, 'Davolio', 'Nancy', 'Vertriebsmitarbeiterin', NULL, 'W', '1984-12-08', 'italienisch', '2008-05-01', '5467', 'Studium mit Abschluß BA in Psychologie an der Colorado State University. Kurs \"The Art of the Cold Call.\"  Mitglied des Clubs \"Toastmasters International\".'),
                                                                                                                                                                                      (2, 'Fuller', 'Andrew', 'Vertriebsmitarbeiter', NULL, 'M', '1988-02-19', 'amerikanisch', '2008-08-14', '3457', 'Studium der Betriebswirtschaft an der University of Dallas; 1971 Doktorarbeit über Internationales Marketing. Andrew spricht fließend Französisch und Italienisch. Er versteht Deutsch und liest deutsche Zeitungen und Zeitschriften. Eintritt in die Firma als Verkaufsrepräsentant, 1992 Verkaufsleiter, Geschäftsführer seit 1993. Mitglied des Sales Management Roundtable und des Verbandes \"Pacific Rim Importers\".'),
                                                                                                                                                                                      (3, 'Leverling', 'Janet', 'Vertriebsmitarbeiterin', NULL, 'W', '1999-08-30', 'amerikanisch', '2008-04-01', '3355', 'Studium mit Abschluß BS in Chemie vom Boston College (1984). Sie hat dort außerdem an dem Kurs \"Betriebsführung und -organisation im Lebensmittel-Einzelhandel\" teilgenommen. Eintritt in die Firma als Verkaufsassistentin 1991. Befördert zur Verkaufsrepräsentantin im Februar 1992.'),
                                                                                                                                                                                      (4, 'Peacock', 'Margaret', 'Vertriebsmitarbeiterin', NULL, 'W', '1973-09-19', 'amerikanisch', '2009-05-03', '5176', 'Studium der Englischen Literatur am Concordia College mit Abschluß BA (1958).  Studium am American Institute of Culinary Arts mit Abschluß MA (1966). Margaret arbeitete in der Londoner Abteilung Juli bis November 1992.'),
                                                                                                                                                                                      (5, 'Buchanan', 'Steven', 'Vertriebsmanager', NULL, 'M', '1981-03-04', 'englisch', '2009-10-17', '3453', 'Studium an der St. Andrews University, Scotland, mit Abschluß BSC (1976). Eintritt in die Firma als Verkaufsrepräsentant 1992. Steven nahm an einem Orientierungskurs in der Seattle Abteilung teil und kehrte dann auf seinen Posten im Londoner Büro zurück. Beförderung zum Verkaufsleiter März 1993. Steven Buchanan hat an mehreren Weiterbildungskursen teilgenommen, darunter \"Erfolgreiches Telemarketing\" und \"Internationales Verkaufsmanagement\". Er spricht fließend Französisch.'),
                                                                                                                                                                                      (6, 'Suyama', 'Michael', 'Vertriebsmitarbeiter', NULL, 'M', '1999-07-02', 'japanisch', '2009-10-17', '4284', 'Abschlüsse: MA in Wirtschaft (Sussex University, 1983) und MBA in Marketing (University of California at Los Angeles, 1986). Weiterbildungskurse: Internationale Verkaufsstrategien sowie Zeit-Management für professionelle Verkaufspersonen. Er spricht fließend Japanisch und liest französische, portugiesische und spanische Fachliteratur, Zeitungen und Zeitschriften.'),
                                                                                                                                                                                      (7, 'King', 'Robert', 'Vertriebsmitarbeiter', 'Dr.', 'M', '1999-05-29', 'englisch', '2011-01-02', '4651', 'Englischstudium an der University of Michigan, Abschluß 1992.  Vorher war Robert King ein Mitglied der amerikanischen Hilfsorganisation \"Peace Corps\". Eintritt in die Firma 1992. Kurs: \"Selling in Europe\". Versetzung 1993 in die Londoner Abteilung.'),
                                                                                                                                                                                      (8, 'Callahan', 'Laura', 'Vertriebskoordinatorin', NULL, 'W', '1994-01-09', 'amerikanisch', '2010-03-05', '2344', 'Studium mit Abschluß BA in Psychologie an der University of Washington. Kurs: Geschäftsfranzösisch. Laura liest französische Zeitschriften und Zeitungen.'),
                                                                                                                                                                                      (9, 'Dodsworth', 'Anne', 'Vertriebsmitarbeiterin', NULL, 'W', '2002-01-27', 'englisch', '2010-11-15', '4520', 'Studienabschluß am St. Lawrence College mit BA. Sie spricht fließend Französisch und Deutsch.'),
                                                                                                                                                                                      (10, 'Otto', 'Marilyn', 'Geschäftsführerin', 'Dr.', 'W', '1993-04-01', 'amerikanisch', '2008-01-01', '1111', 'Studium mit Abschluß MBA in Betriebswirtschaftslehre an der Harvard University. Sprachen: Deutsch, Französich, Spanisch Portugiesisch');
